  function validarLogin(email, senha) {
    let emailValido = email.includes("@") && email.includes(".com");
    let senhaValida =
      senha.length >= 8 &&
      /[A-Z]/.test(senha) &&
      /[a-z]/.test(senha) &&
      /\d/.test(senha);
    if (!emailValido || !senhaValida) {
      console.log("Erro: Email ou senha inválidos");
      return false;
    }
    return true;
  }
