  function extrairNumeros(str) {
    let nums = str.match(/\d+/g);
    if (!nums) return 0;
    return nums.reduce((sum, num) => sum + parseInt(num), 0);
  }

  function media(arr) {
    let soma = 0;
    for (let val of arr) {
      soma += val;
    }
    return soma / arr.length;
  }

  function processarDados() {
    let numeroDaRaiz = 200;
    let resultados = [];
    for (let elemento of dados) {
      let a = extrairNumeros(elemento);
      let f = (Math.sqrt(numeroDaRaiz) + a) / 2;
      numeroDaRaiz += 10.2;
      let g = 2 * f * 3 + 10;
      resultados.push(g);
    }
    return media(resultados);
  }
